(7, '<p class=\"col-lg-4 col-md-4 col-sm-6 col-xs-12\"><img alt=\"\" height=\"106\" src=\"/sites/default/images/Group%2012%402x.png\" width=\"314\" /></p>\r\n\r\n<p class=\"col-lg-4 col-md-4 col-sm-6 col-xs-12\"><img alt=\"\" height=\"200\" src=\"/sites/default/images/unnamed%20(1)%402x.png\" width=\"355\" /></p>\r\n\r\n<p class=\"col-lg-4 col-md-4 col-sm-6 col-xs-12\"><img alt=\"\" height=\"150\" src=\"/sites/default/images/800px-LG_logo_(2015)_svg%402x.png\" width=\"343\" /></p>\r\n\r\n<p class=\"col-lg-6 col-md-6 col-sm-6 col-xs-12\"><img alt=\"\" height=\"100\" src=\"/sites/default/images/Canon_logo_vector%402x.png\" width=\"516\" /></p>\r\n\r\n<p class=\"col-lg-6 col-md-6 col-sm-6 col-xs-12\"><img alt=\"\" height=\"176\" src=\"/sites/default/images/Screenshot_1.png\" width=\"654\" /></p>\r\n', 'ĐỐI TÁC CỦA NHÀ TRƯỜNG', 'full_html'),
(8, '<table border=\"none\" cellpadding=\"1\" cellspacing=\"1\" style=\"width:500px\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"width:48px\"><img alt=\"\" height=\"40\" src=\"/sites/default/images/icons/icons8_home_40px.png\" width=\"40\" /></td>\r\n			<td style=\"width:440px\">Địa chỉ: Xã Dĩnh Trì, TP. Bắc Giang, Tỉnh Bắc Giang</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"width:48px\"><img alt=\"\" height=\"40\" src=\"/sites/default/images/icons/icons8_phone_40px_2.png\" width=\"40\" /></td>\r\n			<td style=\"width:440px\">Điện Thoại: 0240 368 998</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"width:48px\"><img alt=\"\" height=\"40\" src=\"/sites/default/images/icons/icons8_mailbox_40px_1.png\" width=\"40\" /></td>\r\n			<td style=\"width:440px\">Email: caodangviethan@gmail.com</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"width:48px\"><img alt=\"\" height=\"40\" src=\"/sites/default/images/icons/icons8_website_40px_2.png\" width=\"40\" /></td>\r\n			<td style=\"width:440px\">Website: http//vktech.edu.vn</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n', 'Thông tin trường', 'full_html'),
