(12, '<p><iframe height=\"250\" src=\"https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d3494.9389239911816!2d106.2549634!3d21.2869726!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x31356e7f223cb567%3A0x51f7f61ca395656!2zVHLGsOG7nW5nIENhbyDEkeG6s25nIG5naOG7gSBDw7RuZyBuZ2jhu4cgVmnhu4d0IC0gSMOgbiBC4bqvYyBHaWFuZw!5e1!3m2!1svi!2s!4v1621260822295!5m2!1svi!2s\" style=\"border:0;\" width=\"600\"></iframe></p>\r\n', 'Bản đồ', 'full_html'),
(13, '<p class=\"rtecenter\"><span style=\"font-family:Tahoma,Geneva,sans-serif\"><span style=\"font-size:18px\">Trong bối cảnh toàn dân chống dịch Covid</span></span></p>\r\n\r\n<p class=\"rtecenter\"><span style=\"font-family:Tahoma,Geneva,sans-serif\"><span style=\"font-size:18px\">Để thuận tiện cho các bạn học sinh đăng ký</span></span></p>\r\n\r\n<p class=\"rtecenter\"><span style=\"font-family:Tahoma,Geneva,sans-serif\"><span style=\"font-size:18px\">vào trường VIỆT - HÀN</span></span></p>\r\n\r\n<p class=\"rtecenter\"><span style=\"font-family:Tahoma,Geneva,sans-serif\"><span style=\"font-size:18px\">Các bạn hãy điền đầy đủ thông tin vào form đăng ký</span></span></p>\r\n\r\n<p class=\"rtecenter\"><span style=\"font-family:Tahoma,Geneva,sans-serif\"><span style=\"font-size:18px\">để nhà trường xét tuyển cho các bạn:</span></span></p>\r\n\r\n<p class=\"rtecenter\"><img alt=\"\" height=\"386\" src=\"/sites/default/images/duhoc/Mask%20Group%201.png\" width=\"693\" /></p>\r\n', 'Content đăng ký tuyển sinh', 'full_html');
