('node', 'school_post', 0, 11, 11, 'und', 0, '<p>Server – Máy chủ – là một máy tính được thiết kế để xử lý các yêu cầu và gửi dữ liệu đến một máy tính khác qua internet hoặc mạng cục bộ.&nbsp;Máy chủ có thể cung cấp các chức năng khác nhau, thường được gọi là “dịch vụ”, chẳng hạn như chia sẻ dữ liệu hoặc&nbsp;tài nguyên&nbsp;giữa nhiều khách hàng, hay thực hiện tính toán cho khách hàng.&nbsp;Một máy chủ có thể phục vụ nhiều khách hàng và một khách hàng có thể sử dụng nhiều máy chủ.&nbsp;Một máy khách có thể chạy trên cùng một thiết bị hoặc có thể kết nối mạng với một máy chủ trên một thiết bị khác.&nbsp;</p>\r\n\r\n<p>Chức năng của máy chủ là lưu trữ, truy xuất và gửi hoặc “phục vụ” các tệp và dữ liệu cho các máy tính khác trên mạng của nó.&nbsp;Nhiều doanh nghiệp sử dụng mạng cục bộ hoặc “mạng nội bộ” trong văn phòng.&nbsp;Ở quy mô lớn hơn, mạng máy tính trên toàn thế giới mà chúng ta gọi là “Internet” phụ thuộc vào một số lượng lớn máy chủ trên toàn thế giới.&nbsp;Các tệp, dữ liệu và chức năng của một trang web nhất định được dựa trên các máy chủ web.&nbsp;</p>\r\n\r\n<p><img alt=\"Server là gì? Tìm hiểu về server? - Web solutions\" src=\"https://websolutions.com.vn/wp-content/uploads/2019/01/1-29.jpg\" /></p>\r\n', '', 'full_html'),
('node', 'school_post', 0, 13, 13, 'und', 0, '<p>Nội Dung Của Quy Chế Tuyển Sinh</p>\r\n\r\n<p>Có rất nhiều biến thể của Lorem Ipsum mà bạn có thể tìm thấy, nhưng đa số được biến đổi bằng cách thêm các yếu tố hài hước, các từ ngẫu nhiên có khi không có vẻ gì là có ý nghĩa. Nếu bạn định sử dụng một đoạn Lorem Ipsum, bạn nên kiểm tra kĩ để chắn chắn là không có gì nhạy cảm được giấu ở giữa đoạn văn bản. Tất cả các công cụ sản xuất văn bản mẫu Lorem Ipsum đều được làm theo cách lặp đi lặp lại các đoạn chữ cho tới đủ thì thôi, khiến cho lipsum.com trở thành công cụ sản xuất Lorem Ipsum đáng giá nhất trên mạng. Trang web này sử dụng hơn 200 từ la-tinh, kết hợp thuần thục nhiều cấu trúc câu để tạo ra văn bản Lorem Ipsum trông có vẻ thật sự hợp lí. Nhờ thế, văn bản Lorem Ipsum được tạo ra mà không cần một sự lặp lại nào, cũng không cần chèn thêm các từ ngữ hóm hỉnh hay thiếu trật tự.</p>\r\n', '', 'full_html'),
