INSERT INTO `field_revision_body` (`entity_type`, `bundle`, `deleted`, `entity_id`, `revision_id`, `language`, `delta`, `body_value`, `body_summary`, `body_format`) VALUES
('node', 'school_post', 0, 1, 1, 'und', 0, '<p><strong>Tên trường</strong></p>\r\n\r\n<p>Trường Cao đẳng nghề Công nghệ Việt-Hàn Bắc Giang là đơn vị sự nghiệp công lập trực thuộc UBND tỉnh Bắc Giang, được thành lập theo Quyết định số 1176/QĐ-LĐTBXH ngày 31 tháng 8 năm 2012 của Bộ Lao động-Thương binh và Xã hội.</p>\r\n\r\n<p>Tên trường: Trường Cao đẳng nghề Công nghệ Việt-Hàn Bắc Giang</p>\r\n\r\n<p>Tên Tiếng anh: Vietnam-Korea Vocational College of Technology</p>\r\n\r\n<p>Tên rút gọn: VKTech&nbsp;&nbsp;&nbsp;&nbsp;</p>\r\n\r\n<p>Địa chỉ: Xã Dĩnh Trì, thành phố Bắc Giang, tỉnh Bắc Giang.</p>\r\n\r\n<p>Mục tiêu và sứ mạng</p>\r\n\r\n<ol>\r\n	<li><strong>Mục tiêu</strong></li>\r\n</ol>\r\n\r\n<p>Xây dựng đội ngũ giảng viên, giáo viên, chuyên viên và cán bộ quản lý giáo dục chuẩn về chất lượng, đủ về số lượng, đồng bộ về cơ cấu. đủ năng lực thực hiện nhiệm vụ chính của Nhà trường trong thời kỳ mới.</p>\r\n\r\n<p>Xây dựng cơ sở vật chất phòng học, phòng làm việc, phòng thí nghiệm, nhà xưởng thực hành, thư viện theo hướng chuấn hóa, kiên cố hóa và từng bước hiện đại hóa trang thiết bị phục vụ công tác đào tạo, nghiên cứu khoa học và quản lý.</p>\r\n\r\n<p>Nghiên cứu và thực hiện đổi mới phương thức đào tạo, nội dung, chương trình, phương pháp dạy học, cách thức kiềm tra, đánh giá nhằm nâng cao chất lượng đào tạo, đáp ứng yêu cầu đổi mới căn bản, toàn diện giáo dục Việt Nam.</p>\r\n\r\n<p>Tăng cường công tác duy trì trật tự kỷ cương, nề nếp trong trường. Xây dựng môi trường giáo dục lành mạnh, hình thành văn hóa Nhà trường với giá trị cốt lõi: Nhân văn, sáng tạo, thân thiện, bền vững trên cơ sở phát huy tinh thần dân chủ, ý thức tự giác của mỗi cán bộ, giảng viên, giáo viên, nhân viên (CB, GV, NV) và học sinh sinh viên (HSSV) kết hợp với việc tăng cường hiệu lực quản lý nhà nước trong mọi lĩnh vực hoạt động của Nhà trường.</p>\r\n\r\n<p>Xây dựng và duy trì hệ thống quản lý chất lượng đào tạo tiến tới đạt chuẩn kiểm định chất lượng trong nước, khu vực và quốc tế để khẳng định thương hiệu chất lượng cửa trường.</p>\r\n\r\n<p>Phối hợp hoạt động đồng bộ, có hiệu quả cao với tổ chức Đảng, chính quyền và các đoàn thể quần chúng, đoàn kết thống nhất trong tập thể CB, GV, NV của trường đề tạo nên sức mạnh tổng hợp đưa Trường Cao đẳng nghề Công nghệ Việt - Hàn Bắc Giang phát triển nhanh, mạnh và bền vững.</p>\r\n\r\n<p><strong>2. Sứ mạng</strong></p>\r\n\r\n<p>Trường Cao đẳng nghề Công nghệ Việt - Hàn Bắc Giang;</p>\r\n\r\n<p>Đào tạo nguồn nhân lực có uy tín và chất lượng cao đáp ứng nhu cầu xã hội, của doanh nghiệp và góp phần phục vụ quá trình công nghiệp hóa, hiện đại hóa của tỉnh Bắc Giang nói riêng và cả nước nói chung.</p>\r\n\r\n<p>Kết hợp đào tạo với thực hiện nghiên cứu và chuyển giao các kết quả nghiên cứu khoa học về lĩnh vực đào tạo nghề nghiệp và công nghệ kỹ thuật cho xã hội.</p>\r\n\r\n<p>Phấn đấu&nbsp;trở thành cơ sở giáo dục đào tạo đa cấp, đa ngành theo hướng tiên tiến, hiện đại, để có vị trí xứng đáng trong ngành giáo dục nghề nghiệp của Việt Nam và khu vực, đáp ứng nhu cầu nguồn nhân lực chất lượng cao cho sự nghiệp công nghiệp hóa, hiện đại hóa đất nước, trở thành trường Chất lượng cao của Quốc gia, đạt chuẩn ASEAN và Quốc tế.</p>\r\n\r\n<p>Nhiệm vụ, quyền hạn của trường</p>\r\n\r\n<p>1.&nbsp;Tổ chức đào tạo nhân lực trực tiếp cho sản xuất, kinh doanh, dịch vụ trình độ cao đẳng, trình độ trung cấp, trình độ sơ cấp và đào tạo thường xuyên theo quy định.</p>\r\n\r\n<p>2.&nbsp;Tổ chức biên soạn hoặc lựa chọn, phê duyệt và thực hiện các chương trình, giáo trình đào tạo đối với từng ngành, nghề được phép đào tạo theo quy định của Bộ Lao động - Thương binh và Xã hội.</p>\r\n\r\n<p>3.&nbsp;Xây dựng kế hoạch tuyển sinh, tổ chức tuyển sinh đào tạo theo quy định của Bộ Lao động - Thương binh và Xã hội.</p>\r\n\r\n<p>4.&nbsp;Tổ chức các hoạt động đào tạo; kiểm tra, thi, xét công nhận tốt nghiệp và in phôi văn bằng, quản lý, cấp phát, thu hồi, hủy bỏ bằng tốt nghiệp cao đẳng, bằng tốt nghiệp trung cấp, chứng chỉ sơ cấp, chứng chỉ đào tạo theo quy định của Bộ Lao động - Thương binh và Xã hội.</p>\r\n\r\n<p>5.&nbsp;Liên doanh, liên kết với các tổ chức kinh tế, giáo dục, nghiên cứu khoa học trong nước và nước ngoài theo quy định của pháp luật nhằm nâng cao chất lượng đào tạo, gắn đào tạo với việc làm và thị trường lao động.</p>\r\n\r\n<p>6.&nbsp;Tuyển dụng, quản lý giảng viên, cán bộ quản lý, viên chức, người lao động của trường bảo đảm đủ về số lượng, phù hợp với ngành, nghề, quy mô và trình độ đào tạo theo quy định của pháp luật.</p>\r\n\r\n<p>7.&nbsp;Quyết định thành lập các tổ chức trực thuộc trường theo cơ cấu tổ chức được phê duyệt trong quy chế tổ chức, hoạt động của trường; quyết định bổ nhiệm, miễn nhiệm, cách chức các chức vụ từ cấp trưởng phòng, khoa và tương đương trở xuống theo quy định.</p>\r\n\r\n<p>8.&nbsp;Phối hợp với doanh nghiệp, tổ chức, cá nhân, gia đình người học trong hoạt động giáo dục nghề nghiệp.</p>\r\n\r\n<p>9.&nbsp;Phối hợp với doanh nghiệp, cơ sở sản xuất, kinh doanh, dịch vụ trong hoạt động đào tạo về lập kế hoạch đào tạo, xây dựng chương trình, giáo trình đào tạo; tổ chức giảng dạy, hướng dẫn thực hành, thực tập, đánh giá kết quả học tập của người học.</p>\r\n\r\n<p>10.&nbsp;Thực hiện dân chủ, công khai trong việc thực hiện các nhiệm vụ đào tạo, nghiên cứu, ứng dụng các kết quả nghiên cứu, chuyển giao công nghệ vào thực tiễn sản xuất, kinh doanh, dịch vụ và hoạt động tài chính; có cơ chế để người học tham gia đánh giá hoạt động đào tạo, giảng viên tham gia đánh giá cán bộ quản lý, viên chức và người lao động của nhà trường.</p>\r\n\r\n<p>11.&nbsp;Quản lý, sử dụng đất đai, cơ sở vật chất, thiết bị và tài chính của trường theo quy định của pháp luật.</p>\r\n\r\n<p>12.&nbsp;Sử dụng nguồn thu từ hoạt động đào tạo, khoa học, công nghệ, sản xuất, kinh doanh và dịch vụ để đầu tư xây dựng cơ sở vật chất của trường, chi cho các hoạt động đào tạo và bổ sung nguồn tài chính của trường theo quy định của pháp luật.</p>\r\n\r\n<p>13.&nbsp;Được Nhà nước giao hoặc cho thuê đất, giao hoặc cho thuê cơ sở vật chất; được hỗ trợ ngân sách khi thực hiện nhiệm vụ Nhà nước giao theo hợp đồng đặt hàng; được hưởng các chính sách ưu đãi về thuế và tín dụng theo quy định của pháp luật.</p>\r\n', '', 'full_html'),
