('node', 'banner', 0, 128, 128, 'und', 0, '<address><span style=\"font-size:16px\">Thật hạnh phúc vì ngày này cũng đã đến chúng mình bắt chuyến xe đến tương lai cùng nhua nào. Đưa tay đây nào mãi bên nhau bạn nhé, thế giới bên ngoài ...</span></address>\r\n\r\n<h2><a href=\"https://www.youtube.com/watch?v=wGRZwADGOtg\"><span style=\"color:#ffffff\"><strong><span style=\"background-color:#107ca3\">THAM GIA NGAY!</span></strong></span></a></h2>\r\n', '', 'full_html'),
('node', 'banner', 0, 129, 129, 'und', 0, '<address><span style=\"font-size:16px\">Thật hạnh phúc vì ngày này cũng đã đến chúng mình bắt chuyến xe đến tương lai cùng nhua nào. Đưa tay đây nào mãi bên nhau bạn nhé, thế giới bên ngoài ...</span></address>\r\n\r\n<h2><a href=\"https://www.youtube.com/watch?v=wGRZwADGOtg\" tabindex=\"0\"><span style=\"color:#ffffff\"><strong><span style=\"background-color:#107ca3\">Banner Test!</span></strong></span></a></h2>\r\n', '', 'full_html'),
('node', 'banner', 0, 211, 211, 'und', 0, '<p>Thật hạnh phúc vì ngày này cũng đã đến chúng mình cùng nhau bắt chuyến xe đến tương lai. Đưa tay đây nào, mãi bên nhau bạn nhé ...</p>\r\n\r\n<h2><strong><a href=\"https://www.youtube.com/watch?v=OLqz1qTd9iQ\">Đăng ký ngay</a></strong></h2>\r\n', '', 'full_html'),
('node', 'banner', 0, 212, 212, 'und', 0, '<p>Thật hạnh phúc vì ngày này cũng đã đến chúng mình cùng nhau bắt chuyến xe đến tương lai. Đưa tay đây nào, mãi bên nhau bạn nhé ...</p>\r\n', '', 'full_html'),
