CREATE TABLE `webform_emails` (
  `nid` int(10) UNSIGNED NOT NULL DEFAULT 0 COMMENT 'The node identifier of a webform.',
  `eid` smallint(5) UNSIGNED NOT NULL DEFAULT 0 COMMENT 'The e-mail identifier for this row’s settings.',
  `email` text DEFAULT NULL COMMENT 'The e-mail address that will be sent to upon submission. This may be an e-mail address, the special key "default" or a numeric value. If a numeric value is used, the value of a component will be substituted on submission.',
  `subject` text DEFAULT NULL COMMENT 'The e-mail subject that will be used. This may be a string, the special key "default" or a numeric value. If a numeric value is used, the value of a component will be substituted on submission.',
  `from_name` text DEFAULT NULL COMMENT 'The e-mail "from" name that will be used. This may be a string, the special key "default" or a numeric value. If a numeric value is used, the value of a component will be substituted on submission.',
  `from_address` text DEFAULT NULL COMMENT 'The e-mail "from" e-mail address that will be used. This may be a string, the special key "default" or a numeric value. If a numeric value is used, the value of a component will be substituted on submission.',
  `template` text DEFAULT NULL COMMENT 'A template that will be used for the sent e-mail. This may be a string or the special key "default", which will use the template provided by the theming layer.',
  `excluded_components` text NOT NULL COMMENT 'A list of components that will not be included in the [submission:values] token. A list of CIDs separated by commas.',
  `html` tinyint(3) UNSIGNED NOT NULL DEFAULT 0 COMMENT 'Determines if the e-mail will be sent in an HTML format. Requires Mime Mail module.',
  `attachments` tinyint(3) UNSIGNED NOT NULL DEFAULT 0 COMMENT 'Determines if the e-mail will include file attachments. Requires Mime Mail module.',
  `exclude_empty` tinyint(3) UNSIGNED NOT NULL DEFAULT 0 COMMENT 'Determines if the e-mail will include component with an empty value.',
  `extra` text NOT NULL COMMENT 'A serialized array of additional options for the e-mail configuration, including value mapping for the TO and FROM addresses for select lists.',
  `status` tinyint(3) UNSIGNED NOT NULL DEFAULT 1 COMMENT 'Whether this email is enabled.'
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='Holds information regarding e-mails that should be sent...';

